import styled from 'styled-components';

export const TextProgress = styled.div`
  font-family: Verdana;
  text-transform: uppercase;
  font-size: 5em;
  color: #282c34;
  -webkit-text-stroke: 1px salmon;
  background: ${({progress}) => `-webkit-linear-gradient(0,salmon ${progress},#282c34 ${progress},#282c34 100%)`};
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
`;
